import React from 'react';
import masterpiece from '../Posts/post-photo1.jpeg';
import PostFooter from '../Posts/PostFooter';
import './Modal.css';

const Modal = ({ comment }) => {
  console.log(comment);
  return (
    <div className="fixed-modal">
      <div className=""></div>
      <div className="modal modal-wrapper">
        <div className="modal-content">
          <img className="modal-img" src={masterpiece} alt="" />
          <div className="modal-comments">
            <div className=""></div>
            {comment.map((c) => (
              <div>
                {c.senderName}: {c.senderCommentText}
              </div>
            ))}
            <PostFooter />
          </div>
        </div>
      </div>
    </div>
  );
};
export default Modal;
